import React from 'react';
// Removed: import "../styles/footer.css" // CSS is now embedded below

function Footer() {
  return (
    // The main footer section, now with embedded CSS
    <footer className="footer">
      {/* Embedded CSS for the Footer component */}
      <style>
        {`
        .footer {
            background-color: ivory;
            color: brown;
            padding: 50px 0;
            font-family: monospace;
            border: 1px brown solid;
        }

        .footer .credit {
            padding: 2.5rem 1rem;
            color: brown;
            font-weight: normal;
            font-size: 1.5rem;
            text-align: center;
        }

        .footer .credit span {
            color: #28a745;
        }

        .container {
            display: flex;
            justify-content: space-around;
            max-width: 1200px;
            margin: 0 auto;
            margin-bottom: 20px;
            flex-wrap: wrap; /* Added for responsiveness */
        }

        .footer-content {
            flex: 1;
            padding: 0 20px;
            text-decoration: none;
            min-width: 250px; /* Ensure content doesn't get too squished */
            text-align: center; /* Center content within each column */
        }

        @media (max-width: 768px) {
            .footer-content {
                margin-bottom: 20px; /* Add space between stacked columns on smaller screens */
            }
        }

        .footer-content h3 {
            font-size: 1.5rem;
            margin-bottom: 20px;
            text-align: left;
        }

        .footer-content ul {
            list-style: none;
            padding: 0;
        }

        .footer-content ul li {
            font-size: 16px;
            margin-bottom: 10px;
            text-align: left;
        }

        .footer-content ul li a {
            text-decoration: none;
            color: #333;
            transition: color 0.3s ease;
        }

        .footer-content ul li a:hover {
            color: #28a745;
        }

        .social-icons {
            display: flex;
            padding: 0;
            justify-content: center; /* Center social icons */
            margin-top: 15px; /* Space above social icons */
        }
        .social-icons li {
            margin: 0 10px; /* Adjust margin for spacing icons */
            list-style: none;
        }

        .social-icons a {
            color: #333;
            font-size: 24px;
            text-decoration: none;
            transition: color 0.3s ease;
        }

        .social-icons a:hover {
            color: #ff3838;
        }
        `}
      </style>

      {/* Link to Font Awesome for social icons - ensure this is loaded globally in public/index.html */}
      <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.4/css/all.min.css" xintegrity="sha512-..." crossorigin="anonymous" referrerpolicy="no-referrer" />

      <div className="container">
        {/* Contact Us Section */}
        <div className="footer-content">
          <h3>Contact Us</h3>
          <ul>
            <li>Email: vigneshgbecse@gmail.com</li>
            <li>Phone: +91 8525822546</li>
            <li>Address: 132/4, Santhiveerappapuram Street, Punjai Sangenthi, Trichy - 621711, Tamil Nadu</li>
          </ul>
        </div>

        {/* Quick Links Section */}
        <div className="footer-content">
          <h3>Quick Links</h3>
          <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#speciality">Our's Special</a></li>
            <li><a href="#popular">Popular Foods</a></li>
            <li><a href="#review">Customer Reviews</a></li>
          </ul>
        </div>

        {/* Follow Us Section */}
        <div className="footer-content">
          <h3>Follow Us</h3>
          <ul className="social-icons">
            <li><a href="https://www.instagram.com/vicky_vigneshg/" target="_blank" rel="noopener noreferrer"><i className="fab fa-instagram"></i></a></li>
            <li><a href="https://www.linkedin.com/in/vigneshgbe/" target="_blank" rel="noopener noreferrer"><i className="fab fa-linkedin-in"></i></a></li>
            <li><a href="https://www.youtube.com/channel/UC-your-youtube-channel-id" target="_blank" rel="noopener noreferrer"><i className="fab fa-youtube"></i></a></li>
            <li><a href="https://wa.me/+919047606037" target="_blank" rel="noopener noreferrer"><i className="fab fa-whatsapp"></i></a></li>
            <li><a href="https://github.com/Sweety-Vigneshg" target="_blank" rel="noopener noreferrer"><i className="fab fa-github"></i></a></li>
            <li><a href="https://in.pinterest.com/vigneshgbe/" target="_blank" rel="noopener noreferrer"><i className="fab fa-pinterest"></i></a></li>
          </ul>
        </div>
      </div>

      {/* Credit Section */}
      <h1 className="credit">
        created by <span><a href="https://vigneshgbe.neocities.org" target="_blank" rel="noopener noreferrer">Vignesh G</a></span> | all rights are reserved
      </h1>
    </footer>
  );
}

export default Footer;
